import React from 'react'

class Users extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            allUsers: []
        }
        this.getAllUsers = this.getAllUsers.bind(this)
    }

    getAllUsers() {
        //Logic to fetch data from the users table
        fetch('http://localhost:8080/api/users').then(res => res.json()).then(result => {
            this.setState({
                allUsers: result
            })
        }).catch(console.log)
    }

    render(){
        return(
            <div>
                <button type="button" onClick={this.getAllUsers}>Get Users</button>
                <button type="button">Add User</button>
                <table>
                    <tr>
                        <th>Id</th>
                        <th>name</th>
                    </tr>
                {this.state.allUsers.forEach(user => {
                    <tr>
                        <td key={user.id}>{user.id}</td>
                        <td>{user.name}</td>
                        <td>Edit</td>
                        <td>Delete</td>
                    </tr>
                })}
                </table>
            </div>
        )
    }
}

export default Users
